import React, { useEffect, useState } from "react";
import { auth, db } from "../init-firebase";
import { collection, query, where, getDocs, addDoc } from "firebase/firestore";
import Swal from "sweetalert2";
import { Helmet } from "react-helmet";
import Footer from './Footer';
import { useNavigate } from "react-router-dom";
import NavbaR from "./navbar";
import '../styles/bloodsec.css';

const HomePage = () => {
  const [userData, setUserData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [bloodGroup, setBloodGroup] = useState("A+");
  
  const testimonials = [
    { name: 'Virat Kolhi', text: 'I received blood during my surgery...', location: 'India, Bangalore' },
    { name: 'Odean Simith', text: 'I was in a car accident...', location: 'London, UK' },
    { name: 'Elvish', text: 'Donating blood saved my friendâ€™s life...', location: 'India' },
  ]; 

  // Get user data on component mount
  useEffect(() => {
    const getUserData = async () => {
      try {
        const user = auth.currentUser;
        if (!user) {
          Swal.fire("Please log in to view your profile.");
          return;
        }

        const q = query(collection(db, "SinupUser"), where("email", "==", user.email));
        const querySnapshot = await getDocs(q);

        if (!querySnapshot.empty) {
          querySnapshot.forEach((doc) => {
            setUserData(doc.data());
          });
        } else {
          Swal.fire("No user data found in SignUp collection.");
        }
      } catch (error) {
        console.error("Error getting user data:", error);
        Swal.fire("Error retrieving user data. Please try again.");
      } finally {
        setLoading(false);
      }
    };

    getUserData();
  }, []); // Empty dependency array to run once when component mounts

  const handleBloodGroupChange = (event) => {
    setBloodGroup(event.target.value);
  };

  const DonateButton = async () => {
    const user = auth.currentUser;
    if (!user) {
      Swal.fire("Please log in to donate blood.");
      return;
    }

    try {
      const q = query(collection(db, "BloodDonors"), where("Email", "==", user.email));
      const donorSnapshot = await getDocs(q);

      if (!donorSnapshot.empty) {
        Swal.fire("You have already donated blood once.");
        return;
      }

      // Adding the donation record
      await addDoc(collection(db, "BloodDonors"), {
        DonerBloodGroup: bloodGroup,
        Email: user.email,
        DonationDate: new Date(),
        Age: userData?.age,
        Contact: userData?.mobilt,
        Name: userData?.Name,
        City: userData?.city,
        Uid: userData?.uid,
      });

      Swal.fire("Blood donated successfully!");
      setBloodGroup(""); // Reset blood group after donation
    } catch (error) {
      console.error("Error donating blood:", error.message);
      Swal.fire("An error occurred while donating blood. Please try again.");
    }
  };

  return (
    <div>
      <NavbaR />
      <div className="homepage">
        <Helmet>
          <title>HomePage</title>
        </Helmet>

        <section id="BB">
          <h1 className="title">Donate Blood</h1>
          <div className="form-container">
            <select
              name="bloodGroup"
              value={bloodGroup}
              onChange={handleBloodGroupChange}
              className="hover:p-6 transition-all duration-500 bg-transparent outline-none cursor-pointer p-4 shadow-lg text-gray-500 rounded-lg mb-4"
              style={{ border: '1px solid gray' }}
            >
              <option className="bg-red-100 text-gray-400" value="A+">A+</option>
              <option className="bg-red-100 text-gray-400" value="A-">A-</option>
              <option className="bg-red-100 text-gray-400" value="B+">B+</option>
              <option className="bg-red-100 text-gray-400" value="B-">B-</option>
              <option className="bg-red-100 text-gray-400" value="AB+">AB+</option>
              <option className="bg-red-100 text-gray-400" value="AB-">AB-</option>
              <option className="bg-red-100 text-gray-400" value="O+">O+</option>
              <option className="bg-red-100 text-gray-400" value="O-">O-</option>
            </select>
            <p>Selected Blood Group: {bloodGroup}</p>
            <div className="button-group">
              <button onClick={DonateButton} className="btn donate-btn">Donate Blood</button>
            </div>
          </div>
        </section>

        <section className="bg-red-100 py-16">
          <div className="container mx-auto px-4">
            <h2 className="text-4xl font-semibold text-center text-red-600 mb-6">Why Donate Blood?</h2>
            <p className="text-lg text-gray-700 text-center mb-8">
              Donating blood is one of the most selfless acts a person can do...
            </p>
            <div className="flex justify-center gap-6">
              <div className="bg-white p-6 rounded-lg shadow-md max-w-sm">
                <h3 className="text-2xl text-red-600 font-semibold mb-4">Save Lives</h3>
                <p className="text-gray-600">Your donation can help someone...</p>
              </div>
              <div className="bg-white p-6 rounded-lg shadow-md max-w-sm">
                <h3 className="text-2xl text-red-600 font-semibold mb-4">Easy Process</h3>
                <p className="text-gray-600">Blood donation is a simple process...</p>
              </div>
              <div className="bg-white p-6 rounded-lg shadow-md max-w-sm">
                <h3 className="text-2xl text-red-600 font-semibold mb-4">Help Your Community</h3>
                <p className="text-gray-600">Be a hero to someone in need...</p>
              </div>
            </div>
          </div>
        </section>

        <section className="py-16 bg-gray-100">
          <div className="container mx-auto px-4">
            <h2 className="text-4xl font-semibold text-center text-red-600 mb-6">Become a Blood Donor</h2>
            <p className="text-lg text-center text-gray-700 mb-8">Every donation counts...</p>
            <div className="text-center">
              <a href="#BB">
                <button className="bg-red-600 text-white text-lg px-6 py-3 rounded-lg hover:bg-red-700 transition">Donate</button>
              </a>
            </div>
          </div>
        </section>

        <section className="py-16 bg-red-100">
          <div className="container mx-auto px-4">
            <h2 className="text-4xl font-semibold text-center text-red-600 mb-6">What People Are Saying</h2>
            <p className="text-lg text-center text-gray-700 mb-8">Read how blood donation...</p>
            <div className="grid grid-cols-1 sm:grid-cols-3 gap-8">
              {testimonials.map((testimonial, index) => (
                <div key={index} className="bg-white p-6 rounded-lg shadow-md">
                  <p className="text-gray-600 italic mb-4">"{testimonial.text}"</p>
                  <h3 className="text-xl font-semibold text-red-600">{testimonial.name}</h3>
                  <p className="text-gray-500 text-sm">{testimonial.location}</p>
                </div>
              ))}
            </div>
          </div>
        </section>

        <Footer />
      </div>
    </div>
  );
};

export default HomePage;
